<template>
  <svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" :width="width" :height="height" viewBox="0 0 417 341">
  <image id="矢量智能对象" width="417" height="341" xlink:href="data:img/png;base64,"/>
</svg>

</template>

<script>
  const defaultWidth = 417;
  const defaultHeight = 341;
  const mobileHeight = 210;
  export default {
    data() {
      return {
        width: defaultWidth,
        height: defaultHeight
      }
    },
    props: {
      mobile: [String, Boolean]
    },
    watch: {
      mobile: {
        immediate: true,
        handler(val) {
          if (!!val) {
            this.width = "100%";
            this.height = mobileHeight
          } else {
            this.width = defaultWidth
            this.height = defaultHeight
          }
        }
      }
    }
  }
</script>

